import React, { useEffect, useState } from 'react';

function SVARPage() {
  const [data, setData] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      const userEmail = localStorage.getItem('userEmail');
      const response = await fetch(`https://us-central1-optimal-comfort-464220-t1.cloudfunctions.net/loginHandler?email=${userEmail}`);
      const result = await response.json();
      if (result.success) {
        setData(result.violationsData || []);
      } else {
        alert("Failed to fetch SV & AR data");
      }
    };

    fetchData();
  }, []);

  return (
    <div>
      <h1>Current Scanning Violations & ARs</h1>
      {data.length > 0 ? (
        data.map((item, index) => (
          <div key={index}>
            {Object.entries(item).map(([key, value]) => (
              <p key={key}><strong>{key}:</strong> {value}</p>
            ))}
          </div>
        ))
      ) : (
        <p>No data found.</p>
      )}
    </div>
  );
}

export default SVARPage;
